import React from 'react'
import { Card, CardColumns } from 'react-bootstrap';

import Review from './Review';

export default function Reviews({ id }) {
    return (
        <Card id={id}>
            <CardColumns>
                <Review img="https://thispersondoesnotexist.com/image" size={100} name={"Barbie"} text={"J'adore la vie"} />
                <Review img="https://thispersondoesnotexist.com/image" size={100} name={"Barbie"} text={"Super trop bien"} />
                <Review img="https://thispersondoesnotexist.com/image" size={100} name={"Barbie"} text={"Cool cool cool"} />
            </CardColumns>
        </Card>
    )
}
